async function initApp() {
    setupNavigation();
    setupQuotationCalculator();
    setupQuotationStorage();
    setupInvoiceFunctionality();
    setupServiceDropdown();
    setupReminderForm();

    await fetchDataAndRender();

    if (typeof setupBackupFunctionality === 'function') setupBackupFunctionality();
    if (typeof refreshClientTable === 'function') refreshClientTable();
}


// Fetches all data and updates the UI
async function fetchDataAndRender() {
    try {
        const [
            clientsSnapshot,
            quotationsSnapshot,
            invoicesSnapshot,
            remindersSnapshot,
            incomeSnapshot
        ] = await Promise.all([
            db.collection('clients').get(),
            db.collection('quotations').get(),
            db.collection('invoices').get(),
            db.collection('reminders').get(),
            db.collection('income').get()
        ]);

        allClients = clientsSnapshot.docs.map(doc => ({
            ...doc.data(),
            id: doc.id
        }));
        allQuotations = quotationsSnapshot.docs.map(doc => ({
            ...doc.data(),
            id: doc.id
        }));
        allInvoices = invoicesSnapshot.docs.map(doc => ({
            ...doc.data(),
            id: doc.id
        }));
        allReminders = remindersSnapshot.docs.map(doc => ({
            ...doc.data(),
            id: doc.id
        }));

        totalIncome = 0;
        incomeSnapshot.docs.forEach(doc => {
            totalIncome += doc.data().amount || 0;
        });

        loadClients(allClients);
        loadClientsForInvoice(allClients);
        loadQuotations(allQuotations);
        loadInvoices(allInvoices);
        updateDashboardStats(allQuotations, allInvoices, allClients);
        if (typeof refreshClientTable === 'function') refreshClientTable(allClients);

    } catch (e) {
        console.error("Error fetching all data: ", e);
    }
}


// ------------------- NAVIGATION -------------------
function setupNavigation() {
    const menuItems = document.querySelectorAll('.sidebar-menu li');
    const pages = document.querySelectorAll('.page');
    menuItems.forEach(item => {
        item.addEventListener('click', function() {
            menuItems.forEach(i => i.classList.remove('active'));
            this.classList.add('active');
            const pageId = this.dataset.page;
            pages.forEach(p => p.classList.remove('active'));
            document.getElementById(pageId).classList.add('active');
            updateHeaderTitle(pageId);
        });
    });
}

function updateHeaderTitle(pageId) {
    const map = {
        dashboard: 'Dashboard',
        quotations: 'Create Quotations',
        invoices: 'Invoice Generation',
        clients: 'Clients',
        reports: 'Backup & Reports',
        settings: 'Settings'
    };
    const h = document.querySelector('.header h1');
    h.textContent = map[pageId] || 'Dashboard';
}

// ------------------- QUOTATIONS -------------------
const SERVICES = ['Document Typing', 'Visa Renewal', 'Travel & Visa Services', 'Translation', 'Business Documentation', 'Other'];

function setupServiceDropdown() {
    const serviceSelect = document.getElementById('serviceType');
    if (!serviceSelect) return;
    SERVICES.forEach(service => {
        const option = document.createElement('option');
        option.value = service;
        option.textContent = service;
        serviceSelect.appendChild(option);
    });
}

function setupQuotationCalculator() {
    const qEl = document.getElementById('quantity');
    const rEl = document.getElementById('rate');
    if (qEl && rEl) {
        qEl.addEventListener('input', calculateQuotationTotal);
        rEl.addEventListener('input', calculateQuotationTotal);
        calculateQuotationTotal();
    }

    const clientSelect = document.getElementById('clientSelect');
    if (clientSelect) {
        clientSelect.addEventListener('change', async () => {
            const client = allClients.find(c => c.id === clientSelect.value);

            if (client) {
                document.getElementById('clientName').value = client.name || '';
                document.getElementById('clientEmail').value = client.email || '';
                document.getElementById('clientPhone').value = client.phone || '';
            } else {
                document.getElementById('clientName').value = '';
                document.getElementById('clientEmail').value = '';
                document.getElementById('clientPhone').value = '';
            }
        });
    }
}

function calculateQuotationTotal() {
    const qty = Number(document.getElementById('quantity').value) || 0;
    const rate = Number(document.getElementById('rate').value) || 0;
    document.getElementById('total').value = (qty * rate).toFixed(2);
}

function setupQuotationStorage() {
    const form = document.getElementById('quotationForm');
    const exportBtn = document.getElementById('exportAllQuotationsCSV');

    if (form) {
        form.addEventListener('submit', (e) => {
            e.preventDefault();
            if (e.submitter.id === 'generateQuotation') {
                saveQuotation('final');
            } else if (e.submitter.id === 'saveDraft') {
                saveQuotation('draft');
            }
        });
    }

    if (exportBtn) {
        exportBtn.addEventListener('click', () => exportAllQuotationsCSV(allQuotations));
    }

    const tbody = document.getElementById('quotationTable');
    if (tbody) {
        tbody.addEventListener('click', (e) => {
            const btn = e.target.closest('button');
            if (!btn) return;
            const id = btn.dataset.id;
            if (btn.classList.contains('export-quote-pdf')) exportQuotationPDF(id);
            if (btn.classList.contains('delete-quote')) deleteQuotation(id);
            if (btn.classList.contains('mark-complete-quote')) markQuotationComplete(id);
        });
    }
}

async function saveQuotation(status) {
    const clientSelect = document.getElementById('clientSelect');
    const clientId = clientSelect.value;
    const clientName = document.getElementById('clientName').value.trim();
    const clientEmail = document.getElementById('clientEmail').value.trim();
    const serviceType = document.getElementById('serviceType').value;
    const description = document.getElementById('description').value.trim();
    const dueDate = document.getElementById('dueDate').value;
    const quantity = Number(document.getElementById('quantity').value) || 0;
    const rate = Number(document.getElementById('rate').value) || 0;
    const total = Number(document.getElementById('total').value) || 0;

    const q = {
        id: 'Q-' + Date.now(),
        clientId,
        clientName,
        clientEmail,
        serviceType,
        dueDate,
        description,
        quantity,
        rate,
        total,
        status,
        createdAt: new Date().toISOString()
    };

    try {
        await db.collection('quotations').doc(q.id).set(q);

        const reminderDueDate = document.getElementById('reminderDueDate').value;
        const reminderEmail = document.getElementById('reminderEmail').value;
        if (reminderDueDate && reminderEmail) {
            await saveReminder(q.id, clientName, reminderDueDate, reminderEmail, 'Quotation Reminder');
        }

        clearQuotationForm();
        await fetchDataAndRender();
        alert('Quotation saved (' + status + ')');
    } catch (e) {
        console.error("Error saving quotation: ", e);
        alert('Error saving quotation.');
    }
}

function clearQuotationForm() {
    document.getElementById('clientName').value = '';
    document.getElementById('clientEmail').value = '';
    document.getElementById('clientPhone').value = '';
    document.getElementById('serviceType').value = '';
    document.getElementById('description').value = '';
    document.getElementById('dueDate').value = '';
    document.getElementById('clientSelect').value = '';
    document.getElementById('quantity').value = 1;
    document.getElementById('rate').value = 5.00;
    calculateQuotationTotal();
    document.getElementById('reminderDueDate').value = '';
    document.getElementById('reminderEmail').value = '';
}

async function loadQuotations(quotations) {
    const tbody = document.getElementById('quotationTable');
    if (!tbody) return;
    tbody.innerHTML = '';

    try {
        const arr = quotations;
        arr.forEach(q => {
            const tr = document.createElement('tr');
            tr.innerHTML = `
                <td>${q.id}</td>
                <td>${escapeHtml(q.clientName)}</td>
                <td>${escapeHtml(q.serviceType)}</td>
                <td>AED${Number(q.total).toFixed(2)}</td>
                <td>${new Date(q.createdAt).toLocaleDateString()}</td>
                <td>${escapeHtml(q.status)}</td>
                <td>
                    <button class="btn btn-warning export-quote-pdf" data-id="${q.id}">PDF</button>
                    <button class="btn btn-success mark-complete-quote" data-id="${q.id}">Mark Complete</button>
                    <button class="btn btn-danger delete-quote" data-id="${q.id}">Delete</button>
                </td>`;
            tbody.appendChild(tr);
        });
    } catch (e) {
        console.error("Error loading quotations: ", e);
    }
}

