async function deleteQuotation(id) {
    if (!confirm('Delete this quotation?')) return;
    try {
        await db.collection('quotations').doc(id).delete();
        await fetchDataAndRender();
    } catch (e) {
        console.error("Error deleting quotation: ", e);
    }
}

async function markQuotationComplete(id) {
    try {
        const docRef = db.collection('quotations').doc(id);
        await docRef.update({
            status: 'final'
        });
        await fetchDataAndRender();
    } catch (e) {
        console.error("Error updating quotation status: ", e);
    }
}


function exportAllQuotationsCSV(quotations) {
    const arr = quotations;
    if (!arr.length) {
        alert('No quotations to export.');
        return;
    }

    const rows = [
        ['ID', 'Client Name', 'Client Email', 'Service', 'Due Date', 'Description', 'Quantity', 'Rate', 'Total', 'Status', 'Created At']
    ];
    arr.forEach(q => {
        rows.push([
            q.id,
            q.clientName,
            q.clientEmail,
            q.serviceType,
            q.dueDate,
            q.description,
            q.quantity,
            q.rate,
            q.total,
            q.status,
            q.createdAt
        ]);
    });

    downloadCSV('quotations.csv', rows);
}


// ------------------- INVOICES -------------------
function setupInvoiceFunctionality() {
    const invClientSelect = document.getElementById('invClientSelect');
    const quotationSelect = document.getElementById('quotationSelect');
    const addItemBtn = document.getElementById('addItem');
    const taxEl = document.getElementById('tax');
    const saveInvoiceBtn = document.getElementById('saveInvoice');
    const exportAllBtn = document.getElementById('exportAllInvoicesCSV');
    
    if (invClientSelect) invClientSelect.addEventListener('change', () => loadQuotationsForInvoice(invClientSelect.value));
    if (quotationSelect) quotationSelect.addEventListener('change', populateInvoiceFromQuotation);
    if (addItemBtn) addItemBtn.addEventListener('click', addInvoiceItem);
    if (taxEl) taxEl.addEventListener('input', calculateInvoiceTotal);
    if (saveInvoiceBtn) saveInvoiceBtn.addEventListener('click', saveInvoice);
    if (exportAllBtn) exportAllBtn.addEventListener('click', () => exportAllInvoicesCSV(allInvoices));
    
    addInvoiceItem();

    const invoiceTable = document.getElementById('invoiceTable');
    if (invoiceTable) {
        invoiceTable.addEventListener('click', (e) => {
            const btn = e.target.closest('button');
            if (!btn) return;
            const id = btn.dataset.id;
            if (btn.classList.contains('export-invoice-pdf')) exportInvoicePDF(id);
            if (btn.classList.contains('delete-invoice')) deleteInvoice(id);
            if (btn.classList.contains('mark-paid-invoice')) markInvoiceAsPaid(id);
        });
    }
}

function addInvoiceItem(desc = '', qty = 1, price = 0) {
    const container = document.getElementById('invoiceItems');
    if (!container) return;
    const div = document.createElement('div');
    div.className = 'invoice-item';
    div.style.display = 'flex';
    div.style.gap = '8px';
    div.style.marginBottom = '8px';
    div.innerHTML = `
        <input class="item-desc" placeholder="Description" value="${desc}" style="flex:2;padding:8px;border:1px solid #ccc;border-radius:6px;">
        <input class="item-qty" type="number" value="${qty}" min="0" style="width:80px;padding:8px;border:1px solid #ccc;border-radius:6px;">
        <input class="item-price" type="number" step="0.01" value="${price.toFixed(2)}" style="width:110px;padding:8px;border:1px solid #ccc;border-radius:6px;">
        <button class="btn btn-danger remove-item" type="button">Remove</button>`;
    container.appendChild(div);

    div.querySelector('.remove-item').addEventListener('click', () => {
        div.remove();
        calculateInvoiceTotal();
    });
    div.querySelector('.item-qty').addEventListener('input', calculateInvoiceTotal);
    div.querySelector('.item-price').addEventListener('input', calculateInvoiceTotal);
    div.querySelector('.item-desc').addEventListener('input', calculateInvoiceTotal);
    calculateInvoiceTotal();
}

function clearInvoiceItems() {
    const container = document.getElementById('invoiceItems');
    container.innerHTML = '';
}

function calculateInvoiceTotal() {
    let subtotal = 0;
    document.querySelectorAll('.invoice-item').forEach(item => {
        const qty = Number(item.querySelector('.item-qty').value) || 0;
        const price = Number(item.querySelector('.item-price').value) || 0;
        subtotal += qty * price;
    });
    const tax = Number(document.getElementById('tax').value) || 0;
    const total = subtotal + (subtotal * tax / 100);
    document.getElementById('subtotal').value = subtotal.toFixed(2);
    document.getElementById('totalAmount').value = total.toFixed(2);
}

function loadClientsForInvoice(clients) {
    const clientSelect = document.getElementById('invClientSelect');
    if (!clientSelect) return;
    clientSelect.innerHTML = '<option value="">-- Choose client --</option>';
    clients.forEach(client => {
        const option = document.createElement('option');
        option.value = client.id;
        option.textContent = client.name;
        clientSelect.appendChild(option);
    });
}

function loadQuotationsForInvoice(clientId) {
    const quotationSelect = document.getElementById('quotationSelect');
    if (!quotationSelect) return;
    quotationSelect.innerHTML = '<option value="">-- Optional --</option>';
    
    if (!clientId) {
        clearInvoiceItems();
        return;
    }

    const clientQuotations = allQuotations.filter(q => q.clientId === clientId && q.status === 'final');
    clientQuotations.forEach(q => {
        const option = document.createElement('option');
        option.value = q.id;
        option.textContent = `${q.id} - ${q.serviceType} (AED${Number(q.total).toFixed(2)})`;
        quotationSelect.appendChild(option);
    });

    clearInvoiceItems();
    addInvoiceItem();
}

function populateInvoiceFromQuotation() {
    const quotationId = document.getElementById('quotationSelect').value;
    if (!quotationId) {
        clearInvoiceItems();
        addInvoiceItem();
        return;
    }

    const quotation = allQuotations.find(q => q.id === quotationId);
    if (quotation) {
        clearInvoiceItems();
        addInvoiceItem(quotation.serviceType, quotation.quantity, quotation.rate);
    }
}

async function saveInvoice() {
    const invClientSelect = document.getElementById('invClientSelect');
    const client = invClientSelect.options[invClientSelect.selectedIndex].text;
    const clientId = invClientSelect.value;
    if (!clientId) {
        alert('Please select a client.');
        return;
    }
    
    calculateInvoiceTotal();
    const items = Array.from(document.querySelectorAll('.invoice-item')).map(item => ({
        desc: item.querySelector('.item-desc').value || '',
        qty: Number(item.querySelector('.item-qty').value) || 0,
        price: Number(item.querySelector('.item-price').value) || 0,
        lineTotal: ((Number(item.querySelector('.item-qty').value) || 0) * (Number(item.querySelector('.item-price').value) || 0))
    })).filter(it => it.qty > 0 || it.price > 0 || it.desc);

    const paidStatus = document.getElementById('paidStatus').checked;
    
    const invoice = {
        id: 'INV-' + Date.now(),
        clientId,
        client,
        date: document.getElementById('invDate').value || new Date().toISOString().slice(0, 10),
        tax: Number(document.getElementById('tax').value) || 0,
        items,
        subtotal: Number(document.getElementById('subtotal').value) || 0,
        total: Number(document.getElementById('totalAmount').value) || 0,
        paid: paidStatus,
        createdAt: new Date().toISOString()
    };
    try {
        await db.collection('invoices').doc(invoice.id).set(invoice);

        // If paid, update income
        if (paidStatus) {
            await db.collection('income').add({
                invoiceId: invoice.id,
                amount: invoice.total,
                createdAt: new Date().toISOString()
            });
        }
        
        await fetchDataAndRender();
        alert('Invoice saved');
    } catch (e) {
        console.error("Error saving invoice: ", e);
    }
}

function loadInvoices(invoices) {
    const tbody = document.getElementById('invoiceTable');
    if (!tbody) return;
    tbody.innerHTML = '';
    try {
        const arr = invoices;
        arr.forEach(inv => {
            const tr = document.createElement('tr');
            const statusText = inv.paid ? 'Paid' : 'Not Paid';
            tr.innerHTML = `
                <td>${inv.id}</td>
                <td>${escapeHtml(inv.client)}</td>
                <td>${inv.date}</td>
                <td>AED${Number(inv.total).toFixed(2)}</td>
                <td><span class="status-label ${inv.paid ? 'paid' : 'not-paid'}">${statusText}</span></td>
                <td>
                    <button class="btn btn-warning export-invoice-pdf" data-id="${inv.id}">PDF</button>
                    ${!inv.paid ? `<button class="btn btn-success mark-paid-invoice" data-id="${inv.id}">Mark Paid</button>` : ''}
                    <button class="btn btn-danger delete-invoice" data-id="${inv.id}">Delete</button>
                </td>`;
            tbody.appendChild(tr);
        });
    } catch (e) {
        console.error("Error loading invoices: ", e);
    }
}

async function markInvoiceAsPaid(id) {
    if (!confirm('Mark this invoice as Paid?')) return;
    try {
        const invoiceRef = db.collection('invoices').doc(id);
        const invoiceDoc = await invoiceRef.get();
        const invoice = invoiceDoc.data();

        await invoiceRef.update({ paid: true });

        // Add to income collection
        await db.collection('income').add({
            invoiceId: id,
            amount: invoice.total,
            createdAt: new Date().toISOString()
        });

        await fetchDataAndRender();
        alert('Invoice marked as paid.');
    } catch (e) {
        console.error("Error marking invoice as paid: ", e);
        alert('Error marking invoice as paid.');
    }
}


async function exportAllInvoicesCSV(invoices) {
    const arr = invoices;
    if (!arr.length) {
        alert('No invoices');
        return;
    }
    const rows = [
        ['ID', 'Client', 'Date', 'Tax', 'Subtotal', 'Total', 'Paid', 'Items']
    ];
    arr.forEach(inv => rows.push([inv.id, inv.client, inv.date, inv.tax, inv.subtotal, inv.total, inv.paid, inv.items.map(it => `${it.desc}(${it.qty}x${it.price})`).join('|')]));
    downloadCSV('invoices.csv', rows);
}

