async function deleteInvoice(id) {
    if (!confirm('Delete invoice?')) return;
    try {
        await db.collection('invoices').doc(id).delete();
        await fetchDataAndRender();
    } catch (e) {
        console.error("Error deleting invoice: ", e);
    }
}

// ------------------- DASHBOARD -------------------
function updateDashboardStats(quotations, invoices, clients) {
    try {
        const overdueRemindersCount = allReminders.filter(r => r.dueDate && new Date(r.dueDate) < new Date()).length;

        document.getElementById('stat-active').textContent = quotations.filter(x => x.status === 'draft').length;
        document.getElementById('stat-completed').textContent = invoices.length;
        document.getElementById('stat-pending').textContent = quotations.filter(x => x.status === 'draft').length;
        document.getElementById('stat-overdue').textContent = overdueRemindersCount;
        document.getElementById('stat-income').textContent = `AED${totalIncome.toFixed(2)}`;
        updatePendingWorksTable(quotations, invoices, clients, allReminders);
    } catch (e) {
        console.error("Error updating dashboard stats: ", e);
    }
}

function updatePendingWorksTable(quotations, invoices, clients, reminders) {
    const tbody = document.getElementById('pendingWorksTable');
    if (!tbody) return;
    tbody.innerHTML = '';
    const now = new Date();

    const pendingItems = [
        ...quotations.filter(q => q.status === 'draft').map(q => ({
            ...q,
            type: 'Quotation',
            remDays: q.dueDate ? Math.ceil((new Date(q.dueDate).getTime() - now.getTime()) / (1000 * 60 * 60 * 24)) : null,
            isOverdue: q.dueDate ? (new Date(q.dueDate) < now) : false
        })),
        ...reminders.map(r => ({
            ...r,
            type: 'Reminder',
            clientName: r.clientName,
            dueDate: r.dueDate,
            remDays: r.dueDate ? Math.ceil((new Date(r.dueDate).getTime() - now.getTime()) / (1000 * 60 * 60 * 24)) : null,
            isOverdue: r.dueDate ? (new Date(r.dueDate) < now) : false,
            total: 0
        }))
    ];

    pendingItems.sort((a, b) => {
        const dateA = a.dueDate ? new Date(a.dueDate).getTime() : Infinity;
        const dateB = b.dueDate ? new Date(b.dueDate).getTime() : Infinity;
        return dateA - dateB;
    });

    pendingItems.forEach(item => {
        const tr = document.createElement('tr');

        let remainingDaysText = '-';
        if (item.remDays !== null) {
            if (item.remDays < 0) {
                remainingDaysText = 'Overdue';
            } else if (item.remDays === 0) {
                remainingDaysText = 'Due Today';
            } else {
                remainingDaysText = `${item.remDays} day(s)`;
            }
        }

        tr.innerHTML = `
            <td>${item.type}</td>
            <td>${item.id}</td>
            <td>${item.clientName}</td>
            <td>${item.dueDate || '-'}</td>
            <td>${remainingDaysText}</td>
            <td>AED${Number(item.total).toFixed(2)}</td>
            <td>${item.status || 'Active'}</td>
            <td>
                ${item.type === 'Quotation' ? `<button class="btn btn-success mark-complete-pending" data-id="${item.id}">Mark Complete</button>` : `<button class="btn btn-danger delete-reminder-btn" data-id="${item.id}">Delete</button>`}
            </td>`;

        if (item.isOverdue) {
            tr.classList.add('overdue');
        }

        const client = clients.find(c => c.id === item.clientId);
        if (client && client.isVIP) {
            tr.classList.add('vip-client');
        }

        tbody.appendChild(tr);
    });
}

const pendingWorksTable = document.getElementById('pendingWorksTable');
if (pendingWorksTable) {
    pendingWorksTable.addEventListener('click', (e) => {
        const btn = e.target.closest('button');
        if (btn) {
            const id = btn.dataset.id;
            if (btn.classList.contains('mark-complete-pending')) {
                markQuotationComplete(id);
            } else if (btn.classList.contains('delete-reminder-btn')) {
                deleteReminder(id);
            }
        }
    });
}

// ------------------- HELPERS -------------------
async function findClientById(id) {
    try {
        const docRef = db.collection('clients').doc(id);
        const doc = await docRef.get();
        if (doc.exists) {
            return doc.data();
        } else {
            return null;
        }
    } catch (e) {
        console.error("Error finding client: ", e);
        return null;
    }
}

function loadClients(clients) {
    const clientSelect = document.getElementById('clientSelect');
    if (!clientSelect) return;
    clientSelect.innerHTML = '<option value="">-- Choose client --</option>';
    try {
        clients.forEach(client => {
            const option = document.createElement('option');
            option.value = client.id;
            option.textContent = client.name;
            clientSelect.appendChild(option);
        });
    } catch (e) {
        console.error("Error loading clients: ", e);
    }
}

function escapeHtml(text) {
    const div = document.createElement('div');
    div.textContent = text;
    return div.innerHTML;
}

function downloadCSV(filename, rows) {
    const csvContent = "data:text/csv;charset=utf-8," + rows.map(e => e.join(",")).join("\n");
    const encodedUri = encodeURI(csvContent);
    const link = document.createElement("a");
    link.setAttribute("href", encodedUri);
    link.setAttribute("download", filename);
    document.body.appendChild(link); // Required for Firefox
    link.click();
    document.body.removeChild(link);
}